// TradeSum.js
import React, { useState, useEffect } from "react";
import { fetchTrades } from "../api/TradesAPI";
import { formatDate, formatCash } from "../func/functions";

const TradeSum = () => {
  const [trades, setTrades] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [weeklyTrades, setWeeklyTrades] = useState([]);
  const [monthlyTrades, setMonthlyTrades] = useState([]);

  useEffect(() => {
    const getTrades = async () => {
      try {
        const data = await fetchTrades();
        setTrades(data);
        setLoading(false);
      } catch (error) {
        setError(error.message);
        setLoading(false);
      }
    };

    getTrades();
  }, []);

  useEffect(() => {
    if (trades.length > 0) {
      filterTrades(trades);
    }
  }, [trades]);

  const filterTrades = (trades) => {
    const today = new Date();
    const startOfWeek = new Date(
      today.setDate(today.getDate() - today.getDay())
    );
    const startOfMonth = new Date(today.getFullYear(), today.getMonth(), 1);

    const weekly = trades.filter(
      (trade) => new Date(trade.entry_date) >= startOfWeek
    );
    const monthly = trades.filter(
      (trade) => new Date(trade.entry_date) >= startOfMonth
    );

    setWeeklyTrades(weekly);
    setMonthlyTrades(monthly);
  };

  if (loading) {
    return <div>Loading trades...</div>;
  }

  if (error) {
    return <div>Error fetching trades: {error}</div>;
  }

  return (
    <div
      className="trade-summary-container"
      style={{ display: "flex", justifyContent: "space-between" }}
    >
      <div style={{ width: "48%" }}>
        <h3>Weekly</h3>
        <table className="trade-table">
          <thead>
            <tr>
              <th>Date</th>
              <th>Pos.</th>
              <th>Price</th>
              <th>Exit Price</th>
              <th>RoI</th>
            </tr>
          </thead>
          <tbody>
            {weeklyTrades.map((trade) => (
              <tr key={trade.id}>
                <td>{formatDate(trade.entry_date)}</td>
                <td>
                  {trade.symbol} ${trade.strike_price} {trade.option_type}{" "}
                  {formatDate(trade.exp_date)}
                </td>
                <td>${trade.entry_price}</td>-<td>${trade.exit_price}</td>
                <td>{formatCash(trade.exit_price * trade.contracts * 100)}</td>
                <td>{formatCash(trade.net * 100)}</td>
                <td>{(trade.roi * 100).toFixed(2)}%</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <div style={{ width: "48%" }}>
        <h3>Monthly Trades</h3>
        <table className="trade-table">
          <thead>
            <tr>
              <th>Date</th>
              <th>Pos.</th>
              <th>Price</th>
              <th>QTY</th>
              <th>Principal</th>
              <th>Exit Date</th>
              <th>Exit Price</th>
              <th>Total</th>
              <th>Net</th>
              <th>RoI</th>
            </tr>
          </thead>
          <tbody>
            {monthlyTrades.map((trade) => (
              <tr key={trade.id}>
                <td>{formatDate(trade.entry_date)}</td>
                <td>
                  {trade.symbol} ${trade.strike_price} {trade.option_type}{" "}
                  {formatDate(trade.exp_date)}
                </td>
                <td>${trade.entry_price}</td>
                <td>{trade.contracts}</td>
                <td>{formatCash(trade.principal * 100)}</td>
                <td>{formatDate(trade.close_date)}</td>
                <td>${trade.exit_price}</td>
                <td>{formatCash(trade.exit_price * trade.contracts * 100)}</td>
                <td>{formatCash(trade.net * 100)}</td>
                <td>{(trade.roi * 100).toFixed(2)}%</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default TradeSum;
